	`sub_disc_teach_id` INT NOT NULL,
	`score` INT,
	PRIMARY KEY (`id`)
);

CREATE TABLE `Study_time` (
	`id` INT NOT NULL AUTO_INCREMENT,
	`time_start` TIME NOT NULL,
	`time_end` TIME NOT NULL,
	PRIMARY KEY (`id`)
);

CREATE TABLE `Lessons_shedule` (
	`id` INT NOT NULL AUTO_INCREMENT,
